import React, { useState } from "react";

const Accordion = () => {
  const AccData = [
    {
      name: "Adeel Solangi",
      language: "Sindhi",
      id: "V59OF92YF627HFY0",
      bio: "Donec lobortis eleifend condimentum. Cras dictum dolor lacinia lectus vehicula rutrum. Maecenas quis nisi nunc. Nam tristique feugiat est vitae mollis. Maecenas quis nisi nunc.",
      version: 6.1,
    },
    {
      name: "Afzal Ghaffar",
      language: "Sindhi",
      id: "ENTOCR13RSCLZ6KU",
      bio: "Aliquam sollicitudin ante ligula, eget malesuada nibh efficitur et. Pellentesque massa sem, scelerisque sit amet odio id, cursus tempor urna. Etiam congue dignissim volutpat. Vestibulum pharetra libero et velit gravida euismod.",
      version: 1.88,
    },
    {
      name: "Aamir Solangi",
      language: "Sindhi",
      id: "IAKPO3R4761JDRVG",
      bio: "Vestibulum pharetra libero et velit gravida euismod. Quisque mauris ligula, efficitur porttitor sodales ac, lacinia non ex. Fusce eu ultrices elit, vel posuere neque.",
      version: 7.27,
    },
    {
      name: "Abla Dilmurat",
      language: "Uyghur",
      id: "5ZVOEPMJUI4MB4EN",
      bio: "Donec lobortis eleifend condimentum. Morbi ac tellus erat.",
      version: 2.53,
    },
  ];


  const [accId,setAccId]=useState(AccData[0]?.id)

  return (
    <div className="acc-main-div">
      {AccData.map((accData) => {
        return (
          <div onClick={()=>{
            if(accId && accId===accData.id){
              setAccId('')
            }
            else{
              setAccId(accData.id)
            }
          }}>
            <h3>{accData?.name}</h3>
            <p className={accId===accData?.id ? '':'hide'}>
            { accData?.bio}
            </p>
          </div>
        );
      })}
    </div>
  );
};

export default Accordion;
